import React from "react";
import "./Ch.css";
import Backdesign from "./img/background-10.png";

function Ch() {
  return (
    <div className="sec10-container">
      <div className="sec10-background-design">
        <img src={Backdesign} alt="" />
      </div>
    </div>
  );
}

export default Ch;
